import React from 'react';

// third-party
import { FormattedMessage } from 'react-intl';

// assets
import { IconHome } from '@tabler/icons';

// constant
const icons = { IconHome };

// ===========================|| DASHBOARD MENU ITEMS ||=========================== //

const listings = {
    id: 'listings',
    title: <FormattedMessage id="admin & settings" />,
    type: 'group',
    children: [
        {
            id: 'property-listings',
            title: <FormattedMessage id="Listings" />,
            type: 'item',
            url: '/listings',
            icon: icons.IconHome,
            breadcrumbs: false
        },
        {
            id: 'listingsManager',
            title: <FormattedMessage id="Manage Listings" />,
            type: 'item',
            url: '/listings/manage-listings',
            icon: icons.IconCreditCard,
            breadcrumbs: false
        }
    ]
};

export default listings;
